import { useRef, useEffect } from "react";
import { register } from "swiper/element/bundle";

register();

export const FaqCarrousel = () => {
  const swiperElRef = useRef(null);



  return (
    <swiper-container
      ref={swiperElRef}
      slides-per-view="3"
      space-between="30"
      centered-slides="true"
      loop="true"
      navigation="true"
      pagination="true"
    >
      <swiper-slide>
        ¿Este programa es solo para personas con diabetes tipo 1?<br />
        No. Está diseñado para personas con diabetes tipo 1,
        tipo 2 y prediabetes, con análisis de cada paciente
        y planes personalizados según cada caso
      </swiper-slide>
      <swiper-slide>Slide 2</swiper-slide>
      <swiper-slide>Slide 3</swiper-slide>
    </swiper-container>
  );
};

export default FaqCarrousel;
